  async neopixel(args) {
    if (!this.port) {
      alert('    S1!');
      return;
    }
    const pin = args.PIN;
    const tLeds = args.LEDS;
    const r = args.R;
    const g = args.G;
    const b = args.B;
    const brightness = args.BRIGHTNESS;
    var leds = 0;
    switch (tLeds) {
      case '1':
        leds = 0;
        break;
      case '2':
        leds = 1;
        break;
      case '3':
        leds = 2;
        break;
      case '4':
        leds = 3;
        break;
      default:
        leds = 4;
    }
    const cmd = "NEOPIXEL_" + pin.substring(1) + '_' + leds + '_' + r + '_' + g + '_' + b + '_' + brightness;
    await window.serialAPI.write(this.port, cmd);
  }

